import React from 'react'

const FaceRecognition = ({imageURL}) => {
	return (
		<div className='center'>
		 	<React.StrictMode>
			<img alt='' src={imageURL} />
			 </React.StrictMode>
		</div>
	)
}

export default FaceRecognition
